import React, {Component} from 'react';



class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div>
        <Header>
          <h1>Welcome to Shop-R-Us!</h1>
        </Header>
        <Link to="./Cart.js" className="btn btn-primary">View Cart</Link>
      </div>
    );
  }

}

export default App;
